import CountriesModel from "../models/domian/CountriesModel";
import {CountryInfo} from "../../api/apiService";
import CountriesModals from '../models/domian/CountriesModel'




export const autocompleteControlViewModel = (model: typeof CountriesModel) => {


  async function getSearchCountriesAsync(value: string) {
    await model.getSearchCountriesAsync(value);
  }
}


